original_question:
Kolmio $ABC$ on tasakylkinen, ja siinä $AB=AC$ ja korkeus $AM=11.$ Oletetaan, että piste $D$ on janalla $\overline{AM}$ siten, että $AD=10$ ja $\angle BDC=3\angle BAC.$ Laske kolmion $ABC$ piiri.

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

